import React, { Component } from 'react'

export default class test extends Component {
  constructor(props){
    super(props)


    this.state = {
      secound : 1,
      secoundDef : 1
    }
  }
  componentDidMount(){
    // count();
    this.count();
  }

  count = ()=>{

    setInterval(() => {
      if(this.state.secound == 5){
        console.log('Event');
        this.setState({ secound : this.state.secoundDef })
      }else{
        var secound = this.state.secound+1;
        this.setState({secound : secound});
      }
    }, 1000);
  }

  render() {
    var today = new Date();
    var dateToDay = today.getFullYear()+'-'+today.getMonth()+'-'+today.getDate();

    return (
      <div>
        <h1>Hello React To Day is : {dateToDay} : {this.state.secound}</h1>
      </div>
    )
  }
}
